Самый современный, качественный и технически оснащённый привод из существующих - RK-74-CQB производства компании G&G. Представляет собой тактическую версию автомата Калашникова АК74СУ, изготовленную полностью из алюминиевого сплава! Привод оснащен по последнему слову техники:
⠀
+ тактическое цевье со слотами кеймод и направляющими пикатинни;
+ анатомическая пистолетная рукоять;
+ крышка ствольной коробки, зафиксированная на втулке, также имеет направляющую пикатинни;
+ многопозиционный телескопический приклад, выполненный из ударопрочного ABS-пластика.
⠀
Аккумулятор в данной версии должен быть трёхлепестковым, 11,1В и устанавливаться в цевье. При желании проводку можно развернуть и использовать стандартные аккумуляторы АК-типа.
Одной из особенностей данного привода является установленный в электрической цепи электронный ключ MOSFET, с помощью которого можно запрограммировать привод стрелять короткими очередями по три шара.

