I have had my PC since 2016 and I avoided pretty much every game that didn't have GamePad support. Over the last 2 month I decided too give the Mouse another chance.

Max Payne 1 to 3 and Xiii have been my go to games too train my mouse aim. I noticed the Mouse was easy too use but my shots were terrible, over and under aiming and my sensitivity just wasn't right.

Then I found #aimlab by @statespacelabs on steam and after 3 Days using the software I have found a sensitivity that currently works for me.

I still have many areas to improve, which I will work on over the next few weeks.

If you have trouble adjusting or just want to improve your mouse aim and reaction time give Aim Labs ago.

